import React from 'react';
import {BrowserRouter, Route, Switch,Redirect} from 'react-router-dom';
import PrivateHomeIndex from '../components/private/home/PrivateHomeIndex';
import UsersRouting from '../components/private/users/routing/UsersRouting';
import LoginComponent from '../components/public/login/LoginComponent';
import PrivateRoute from './PrivateRoute';
import Sidebar from '../components/private/layaout/Sidebar';
import { asyncComponent } from 'react-async-component';
import AuthenticationService from '../auth/services/AuthenticationService';

const Catalog = asyncComponent({
  resolve: () => import("C:/Users/Jose/AppData/Roaming/npm/node_modules/@unsafecode/react-microfrontend-catalog")
});
const Cart = asyncComponent({
  resolve: () => import("C:/Users/Jose/AppData/Roaming/npm/node_modules/@unsafecode/react-microfrontend-cart")
});

class Router extends React.Component {
  state = {
    Visible: AuthenticationService.isUserAuthenticated() 
  }
  render() {
    return (
        <BrowserRouter>             
            <Switch>                 
            <div className="app-routes">
              {this.Visible && <Sidebar/>}              
              <Route path="/login"
                     render={(props) => <LoginComponent {...props} onLogin={this.onLogin}/>}/>              
              <PrivateRoute path="/catalog" exact component={Catalog}/>              
              <PrivateRoute path="/cart" exact component={Cart}/>              
              <PrivateRoute path="/users" exact component={UsersRouting}/>
              {/* <PrivateRoute path="/home" component={PrivateHomeIndex}/> */}
              {/* <PrivateRoute path="/" component={PrivateHomeIndex}/> */}
              {/* <PrivateRoute path="/" component={UsersRouting}/> */}
              <Redirect from='/' to="/login" />              
              </div>
            </Switch>          
        </BrowserRouter>
    );
  }
};

export default Router;
